import React from 'react'

const List = ({ items }) => {
    return (
        <ul className='package__listing'>
            {items.map(({ id, icon, text }) => (
                <li key={id}>
                    <button
                        aria-label='list icon'
                        className='package__listing__button'
                    >
                        {icon}
                    </button>
                    {text}
                </li>
            ))}
        </ul>
    )
}

export default List
